import React from "react";

const ConfigLeft = () => {
  return (
    <div className="configLeft">

<h5 className="fontWeight-600 fileConfigHead colorBlack">
          File Configuration
        </h5>
      <div className="fileConfigHeadBox d-flex justify-content-between align-items-center">

      </div>

      <div className="configTopContent row">
        <div className="col-8">
          <div className="lightBlueBox configTopLeftBox">Hi</div>
        </div>
        <div className="col-4">
          <div className="lightBlueBox configTopRightBox">Hlo</div>
        </div>
      </div>
    </div>
  );
};

export default ConfigLeft;
